Outline (from IMDB):
Lane Meyer is a depressed teen who looses his girlfriend Beth. This is her reason for the split; &quot;Lane, I think it&amp;#039;d be in my best interest if I dated somebody more popular. Better looking. Drived a nicer car.&quot; Anyway, poor Lane is left alone and thinks up treacherous ways of killing himself. He finally meets a French beauty called Monique and falls for her. Simultaneously, he must endure his mothers terrible cooking which literally slides off the table, his disgusting next door neighbour Ricky (and his mum) and he must prepare for the skiing race of his life - to get his old girlfriend back!
